import axios from 'axios';

const iState = {name:"",email:"",phno:"",startDate:new Date()}
//const iState = {users:[]}

const reducer = (state=iState, action) => {
    switch(action.type){
        case 'BOOK':
            axios.post('http://localhost:5000/meetings',{
                doc_id:"id1",
                name:action.payload.name,
                phno:action.payload.phno,
                email:action.payload.email,
                start_date:action.payload.startDate,
                end_date:action.payload.startDate

            })
            return action.payload
        default:
            return state
    }
}

export default reducer
